import React from 'react';
import { withRouter } from 'react-router-dom'
import MenuItem from '../menu-item/menu-item.component'
import './directory.style.scss'
class Directory extends React.Component{
    constructor(){
        super();
        this.state={
            sections: [{id:1,title:'ho',imageUrl:'https://www.newgenapps.com/wp-content/uploads/2020/04/1_c_fiB-YgbnMl6nntYGBMHQ-1080x675.jpeg'},{id:1,title:'ho',imageUrl:'d'},{id:1,title:'ho',imageUrl:'d'},{id:1,title:'ho',imageUrl:'d'},{id:1,title:'ho',imageUrl:'d'}]
        }
    }
    render(){
        return (
            <div className='directory-menu'>
                {
                    this.state.sections.map(({id, title, imageUrl}) =>(
                        <MenuItem key={id} title={title} img={imageUrl}/>
                    ))
                }
            </div>
        )
    }
}

export default Directory;
